import React from 'react'
import Background from "./img/Banners/AAC-insights.jpg"
import "./scss/insights/scss"

export default class Insights extends React.Component {
  render() {
    return (
      <div className="blog">
      <div className="mainpage-banner page" style={{backgroundImage: `url(${Background}`}}>
        <h1 className="mainpage-banner-text">Change is inevitable, progress is a choice.</h1>
      </div>
      </div>
    )
  }
}
